import{_ as e,o as s,c as t,S as a}from"./chunks/framework.f15d8f8c.js";const o="/image/entry-response-02.png",r="/image/entry-response-05.png",n="/image/entry-response-04.png",i="/image/dynamic-response-msg-01.png",_=JSON.parse('{"title":"Form Success Response","description":"","frontmatter":{},"headers":[],"relativePath":"documentation/form-response/form-success-response.md","filePath":"documentation/form-response/form-success-response.md","lastUpdated":1679719539000}'),c={name:"documentation/form-response/form-success-response.md"},l=a('<h1 id="form-success-response" tabindex="-1">Form Success Response <a class="header-anchor" href="#form-success-response" aria-label="Permalink to &quot;Form Success Response&quot;">​</a></h1><p>Through this option, you can match the success response (returned from server), when a <strong>form/entry</strong> is submitted, When It matches with given <strong>success response</strong>, <strong>entry</strong> will be marked as <strong>Entry Saved</strong> and You can also set the <a href="#action">action</a></p><img src="'+o+'" width="400" height="400" alt="Form Success Response"><h2 id="options" tabindex="-1">Options <a class="header-anchor" href="#options" aria-label="Permalink to &quot;Options&quot;">​</a></h2><h3 id="success-page-url" tabindex="-1">Success Page URL <a class="header-anchor" href="#success-page-url" aria-label="Permalink to &quot;Success Page URL&quot;">​</a></h3><p>Fill in the URL of the page on which you want to match the success response.</p><ul><li>It may be full URL</li><li>It may be URL with Regular Expression</li></ul><h3 id="match-url-types" tabindex="-1">Match URL Types <a class="header-anchor" href="#match-url-types" aria-label="Permalink to &quot;Match URL Types&quot;">​</a></h3><p>How you want to match with <strong>Success Page URL</strong></p><ul><li>Match with Full URL</li><li>Match with URL <a href="https://developer.mozilla.org/en-US/docs/Web/API/URL/pathname" target="_blank" rel="noreferrer">pathname</a></li><li>Match with URL <a href="https://developer.mozilla.org/en-US/docs/Web/API/URL/hostname" target="_blank" rel="noreferrer">hostname</a></li><li>Match with RegEx</li></ul><h3 id="success-response-type" tabindex="-1">Success Response Type <a class="header-anchor" href="#success-response-type" aria-label="Permalink to &quot;Success Response Type&quot;">​</a></h3><p>It is about, How server returns Success Response to User.</p><ol><li>Matching Message In Page</li><li><a href="#matching-message-in-alert-message">Matching Message In Browser Alert</a></li><li>Matching Message In Page Element Value</li><li>Checking Element Exists In Page</li></ol><h4 id="matching-message-in-alert-message" tabindex="-1">Matching Message In Alert Message <a class="header-anchor" href="#matching-message-in-alert-message" aria-label="Permalink to &quot;Matching Message In Alert Message&quot;">​</a></h4><p>If the response of the entry comes in the form of <strong>javascript dialog</strong> (Browser Alert), you can hide the dialog from <a href="/documentation/extension.html#hide-javascript-dialog">extension settings</a> and fetch the response to match against given <strong>Enter Success Message</strong></p><h3 id="enter-success-message" tabindex="-1">Enter Success Message <a class="header-anchor" href="#enter-success-message" aria-label="Permalink to &quot;Enter Success Message&quot;">​</a></h3><p>If Server returns something back to user after form is successfully submitted, Then you can use it along with <strong>Success Response Type</strong> to check If form is really saved.</p><p>Here you can have multiple messages. If any of the given messages is matched, then the extension will mark the current entry as <strong>saved</strong> and after that, it will execute the <a href="#action">action</a> given by you.</p><p>Example:- Success messages</p><img src="'+r+'" alt="Form Success Response"><br><blockquote><h4 id="will-the-success-message-be-checked-across-the-page" tabindex="-1">Will the success message be checked across the page? <a class="header-anchor" href="#will-the-success-message-be-checked-across-the-page" aria-label="Permalink to &quot;Will the success message be checked across the page?&quot;">​</a></h4></blockquote><p><strong>Yes</strong>. By Default success messages are checked across the page. With <strong>Message Selector Query</strong> Option, you can give selector query of any element of the page, and <strong>success messages</strong> will only be checked in that selector query scope.</p><img src="'+n+'" alt="Form Success Response"><br><blockquote><h4 id="will-the-entry-be-filled-if-the-success-message-is-already-present-in-the-page" tabindex="-1">Will the entry be filled, if the success message is already present in the page? <a class="header-anchor" href="#will-the-entry-be-filled-if-the-success-message-is-already-present-in-the-page" aria-label="Permalink to &quot;Will the entry be filled, if the success message is already present in the page?&quot;">​</a></h4></blockquote><p>If any success message is present in the page <strong>before</strong> submitting the form, then the extension will have a match against the given <strong>success messages</strong> before the entry and the <strong>entry will not be filled</strong>.</p><h3 id="delay-time-before-run-action" tabindex="-1">Delay Time Before Run Action <a class="header-anchor" href="#delay-time-before-run-action" aria-label="Permalink to &quot;Delay Time Before Run Action&quot;">​</a></h3><p>Time delay before the action is executed. Set time in the Milliseconds. (1 seconds = 1000 milliseconds)</p><h3 id="action" tabindex="-1">Action <a class="header-anchor" href="#action" aria-label="Permalink to &quot;Action&quot;">​</a></h3><ul><li>Redirect to Page</li><li>Re-Execute Form</li><li>Click on Button</li></ul><h2 id="dynamic-success-message" tabindex="-1">Dynamic Success Message <a class="header-anchor" href="#dynamic-success-message" aria-label="Permalink to &quot;Dynamic Success Message&quot;">​</a></h2><p>If server response is dynamic or changes every time or It has some data from any column from excel, then you can use variable like this.</p><img src="'+i+'" width="400" height="400" alt="Entry Response"><p>Apart from this, if you only give <strong>&quot;OTP number send to this mobile&quot;</strong> in the success message, it will also work.</p>',35),h=[l];function u(g,m,p,d,f,y){return s(),t("div",null,h)}const k=e(c,[["render",u]]);export{_ as __pageData,k as default};
